import React, {Component} from 'react'
import {FaToggleOff, FaToggleOn} from "react-icons/fa"



const Task = ({id, task, task_status, date, priority}: {id: string, task: string, task_status: boolean, date: Date, priority: number}) => {
    return (
        <div>
            {task_status ? <FaToggleOn/> : <FaToggleOff/>}
            <h2>{task}</h2>
        </div>
    )

}

export default Task
